import React from "react";
import Rcard from "./Rcard";
const ReceivedRequests = () => {
  return (
    <div
      style={{
        display: "flex",
        width: "100%",
        // border: "1px solid red",
        justifyContent: "space-between",
        flexWrap: "wrap",
      }}
    >
      <Rcard status={1}/>
      <Rcard status={1}/>
      <Rcard status={1}/>
      <Rcard status={1}/>
      <Rcard status={1}/>
      <Rcard status={-1}/>
    </div>
  );
};

export default ReceivedRequests;
